The parking app to find and pay for parking. Millions of parkings already in Europe and the U.S.

Key features:

- See available parking options nearby;
- Extend or end your parking based on your needs;
- Pay only for the exact time you park;
- See the route back to your parked car;

Start using in less than a minute.

How it works:

1. Open the ParkMan app and choose where you want to park your car.
2. Park your car, and press “park here”, and confirm your parking.
3. When you get back to your car, press the “stop parking” button. Your payment card will be charged for the parkings you’ve made at the beginning of the following month.

Use ParkMan and forget about parking stress for good! Invite friends and earn free parkings!
